import React, { useState } from "react";
import * as XLSX from "xlsx";

const CurriculumRedundancyChecker = () => {
  const [tableData, setTableData] = useState([]);
  const [redundantPairs, setRedundantPairs] = useState([]);
  const [fileName, setFileName] = useState("");

  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (!file) return;

    setFileName(file.name);
    const reader = new FileReader();
    reader.readAsBinaryString(file);
    reader.onload = (e) => {
      const binaryString = e.target.result;
      const workbook = XLSX.read(binaryString, { type: "binary" });

      const sheetName = workbook.SheetNames[0];
      const sheet = workbook.Sheets[sheetName];

      const data = XLSX.utils.sheet_to_json(sheet, { header: 1 });
      console.log("Parsed Excel Data:", data);
      setTableData(data);
    };
  };

  const checkRedundancy = () => {
    if (tableData.length === 0) return;

    let pairs = [];
    const similarityThreshold = 0.75; // Adjust as needed

    for (let i = 1; i < tableData.length; i++) {
      for (let j = i + 1; j < tableData.length; j++) {
        let course1 = tableData[i][0]?.trim();
        let course2 = tableData[j][0]?.trim();

        if (course1 && course2) {
          let similarity = calculateSimilarity(course1, course2);
          if (similarity >= similarityThreshold) {
            pairs.push({ course1, course2, similarity: similarity.toFixed(2) });
          }
        }
      }
    }

    setRedundantPairs(pairs);
  };

  const calculateSimilarity = (str1, str2) => {
    const words1 = new Set(str1.toLowerCase().split(/\s+/));
    const words2 = new Set(str2.toLowerCase().split(/\s+/));

    const intersection = new Set([...words1].filter(word => words2.has(word)));
    const union = new Set([...words1, ...words2]);

    return intersection.size / union.size;
  };

  const clearData = () => {
    setTableData([]);
    setRedundantPairs([]);
    setFileName("");
  };

  return (
    <div className="max-w-4xl mx-auto p-6 bg-white shadow-md rounded-lg">
      <h1 className="text-3xl font-bold mb-4">📚 Curriculum Redundancy Checker</h1>

      <div className="mb-4">
        <input type="file" accept=".xlsx" onChange={handleFileUpload} className="border p-2 rounded" />
        {fileName && <p className="text-gray-600 mt-1">Uploaded: {fileName}</p>}
      </div>

      <div className="flex gap-2">
        <button onClick={checkRedundancy} className="bg-blue-600 text-white px-4 py-2 rounded">
          ✅ Check Redundancy
        </button>
        <button onClick={clearData} className="bg-red-500 text-white px-4 py-2 rounded">
          ❌ Clear Data
        </button>
      </div>

      {tableData.length > 0 && (
        <div className="mt-6">
          <h2 className="text-xl font-bold mb-2">📂 Uploaded Dataset</h2>
          <div className="grid grid-cols-2 gap-4">
            <div>
              <h3 className="font-bold">{tableData[0][0]}</h3>
              {tableData.slice(1).map((row, index) => (
                <p key={index} className="text-gray-700">{row[0]}</p>
              ))}
            </div>
            <div>
              <h3 className="font-bold">{tableData[0][1]}</h3>
              {tableData.slice(1).map((row, index) => (
                <p key={index} className="text-gray-700">{row[1]}</p>
              ))}
            </div>
          </div>
        </div>
      )}

      {redundantPairs.length > 0 && (
        <div className="mt-6">
          <h2 className="text-xl font-bold">🔄 Redundant Course Pairs</h2>
          <ul className="list-disc ml-6 mt-2">
            {redundantPairs.map((pair, index) => (
              <li key={index} className="text-gray-700">
                <strong>{pair.course1}</strong> ↔ <strong>{pair.course2}</strong> (Similarity: {pair.similarity})
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default CurriculumRedundancyChecker;
